import React, { useState } from 'react';
import p1 from  "./paris.jpg"
import p2 from  "./berlin.jpeg"
import p3 from  "./london.jpeg"
import p4 from  "./rome.jpeg"

import p5 from  "./lion.jpeg"
import p6 from  "./elephant.jpeg"
import p7 from  "./tiger.jpeg"
import p8 from  "./giraffe.jpeg"

import p9 from  "./earth.jpeg"
import p10 from  "./mars.jpeg"
import p11 from  "./jupiter.jpeg"
import p12 from  "./saturn.jpeg"

import p13 from  "./monalisa.jpeg"
import p14 from  "./vangogh.jpeg"
import p15 from  "./picasso.jpeg"
import p16 from  "./michelangelo.jpeg"


const questions = [
  {
    question: 'What is the capital of France?',
    options: [
      { image: [p1], name: 'Paris' },
      { image: [p2], name: 'London' },
      { image: [p3], name: 'Berlin' },
      { image: [p4], name: 'Rome' }
    ],
    answer: [p1]
  },
  {
    question: 'Which animal is known as the "King of the Jungle"?',
    options: [
      { image: [p5], name: 'Lion' },
      { image: [p6], name: 'Elephant' },
      { image: [p7], name: 'Tiger' },
      { image: [p8], name: 'Giraffe' }
    ],
    answer: 'Lion'
  },
  {
    question: 'What is the largest planet in our solar system?',
    options: [
      { image: [p9], name: 'Earth' },
      { image: [p10], name: 'Mars' },
      { image: [p11], name: 'Jupiter' },
      { image: [p12], name: 'Saturn' }
    ],
    answer: 'jupiter.jpg'
  },
 
  {
    question: 'Who painted the Mona Lisa?',
    options: [
      { image: [p13], name: 'Leonardo da Vinci' },
      { image: [p14], name: 'Vincent van Gogh' },
      { image: [p15], name: 'Pablo Picasso' },
      { image: [p16], name: 'Michelangelo' }
    ],
    answer: 'monalisa.jpg'
  }
];

const Quiz = () => {
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [selectedOption, setSelectedOption] = useState('');
  const [score, setScore] = useState(0);
  const [showScore, setShowScore] = useState(false);
  const [userAnswered, setUserAnswered] = useState(false);

  const handleOptionSelect = (option) => {
    if (!userAnswered) {
      setSelectedOption(option);
    }
  };

  const handleNextQuestion = () => {
    setUserAnswered(true);
    if (selectedOption === questions[currentQuestion].answer) {
      setScore(score + 1);
    }
    if (currentQuestion < questions.length - 1) {
      setTimeout(() => {
        setCurrentQuestion(currentQuestion + 1);
        setSelectedOption('');
        setUserAnswered(false);
      }, 1000); // Delay before moving to the next question
    } else {
      setShowScore(true);
    }
  };

  return (
    <div style={{ maxWidth: '800px', margin: '0 auto', textAlign: 'center' }}>
      {showScore ? (
        <div style={{ marginBottom: '20px' }}>
          <h2>You scored {score} out of {questions.length}</h2>
        </div>
      ) : (
        <div style={{ marginBottom: '20px' }}>
          <h2>Question {currentQuestion + 1}</h2>
          <div style={{ fontSize: '20px', marginBottom: '10px' }}>
            {questions[currentQuestion].question}
          </div>
          <div style={{ display: 'flex', justifyContent: 'center', flexWrap: 'wrap' }}>
            {questions[currentQuestion].options.map((option, index) => (
              <button 
                key={index} 
                style={{ 
                  margin: '10px', 
                  padding: '0', 
                  border: 'none', 
                  background: 'none', 
                  cursor: 'pointer' 
                }} 
                className={selectedOption === option.image ? 'selected' : ''} 
                onClick={() => handleOptionSelect(option.image)}
              >
                <img 
                  src={option.image} 
                  alt={option.name} 
                  style={{ 
                    width: '150px', 
                    height: '150px', 
                    borderRadius: '10px', 
                    transition: 'transform 0.3s ease',
                    transform: selectedOption === option.image ? 'scale(1.1)' : 'scale(1)'
                  }} 
                />
                <div style={{ marginTop: '5px', fontSize: '16px' }}>{option.name}</div>
              </button>
            ))}
          </div>
          {selectedOption && (
            <button 
              style={{ marginTop: '20px', padding: '10px 20px', fontSize: '16px', cursor: 'pointer' }} 
              onClick={handleNextQuestion}
            >
              Next
            </button>
          )}
        </div>
      )}
    </div>
  );
};

export default Quiz;
